import { Component } from "react";
import {Link} from "react-router-dom"
import './login.css'
class Login extends Component {
    constructor()
    {
        super(props)
        this.state = {
            email : "",
            password : ""
        }

    }

    SendData =()=>
    {
        alert(this.state.email + "  \t"+ this.state.password)
    }

    render() {
        return (
            <div >
                <div className="fst_half container-fluid" 
                    style={{
                        background : "#FF9900"
                    }}
                >
                    {/* Navbar */}
                    <nav className="navbar container" style={{ display: "flex", justifyContent: "space-around", padding: "3% 0" }}>
                        <div>
                            <h2 className="navbar-brand bb"><strong>Kavin</strong>Groups </h2>
                        </div>


                        <div >
                            <div>
                                <Link to="/login" className="btn ll1" id='idll1'  >Login</Link>
                                <Link to="/signup" className="btn ll1" id='idll2' >Signup </Link>
                            </div>
                        </div>
                    </nav>
                </div>

                <div className="logg">
                    <h2>Login</h2>
                    <p>Email :</p>
                    <input type="text" className="form-control" onChange={(event)=>{this.setState(
                        {
                            email : event.target.value
                        }
                    )}} /><br></br>
                    <p>Password :</p>
                    <input type="password" className="form-control" onChange={(event)=>{this.setState({password : event.target.value})}} /><br></br>
                    <input type="button" value="Login" className="form-control btn"
                    onClick={this.SendData}
                    style={{background:"#FF9900"}} /><br></br><br></br>
                    <Link to="/signup">New user ? </Link>
                </div>
            </div>
        )
    }
}

export default Login
